import React from "react";

export const Footer = () => {
  return (
    <section>
      <div className="">
                <img
                    className="w-3"
                    src="/treaty-png-1.svg"
                    alt=""
                />
            </div>
      <div className="mx-auto container">
        <div className="flex flex-wrap">
          <div className="w-4/12">
            <img className="w-3" src="/treaty-png-1.svg" alt="" />
          </div>
        </div>
      </div>
    </section>
  );
};
